import { Avatar } from '@material-ui/core';
import React from 'react';
import "./Post.css";

function Post({profilePic, image, username, timestamp, message}) {
    return (
        <div className="post">
            <div className="post__top">
                <Avatar src={profilePic} />
            </div>
        </div>
    )
}

export default Post
